/*!50003 CREATE*/ /*!50020 DEFINER=`pablo`@`192.168.1.%`*/ /*!50003 FUNCTION `sumatoriaDifCaptura`(FechaFila VARCHAR(10), CABINAID INT, TraficoCapturaActu DECIMAL) RETURNS varchar(30) CHARSET utf8
BEGIN

DECLARE AcumuladoSuma VARCHAR(30);
DECLARE TraficoCaptura VARCHAR(30);

    IF TraficoCapturaActu IS NULL THEN

		SET TraficoCaptura=0;

	END IF;

	IF TraficoCapturaActu IS NOT NULL THEN

		SET TraficoCaptura=TRUNCATE(TraficoCapturaActu,2);

	END IF;

SELECT (
  SUM(b.FijoLocal) 
+ SUM(b.FijoProvincia) 
+ SUM(b.FijoLima) 
+ SUM(b.Rural) 
+ SUM(b.Celular) 
+ SUM(b.LDI) 
- (SUM(b.TraficoCapturaDollar * TRUNCATE(p.Valor,2)) + (TRUNCATE(TraficoCaptura,2) * TRUNCATE(p.Valor,2)))  
) / TRUNCATE(p.Valor,2)
INTO AcumuladoSuma 
FROM balance b, Paridad p
WHERE b.PARIDAD_Id = p.Id and b.Fecha>=CONCAT(YEAR(FechaFila),'-',MONTH(FechaFila),'-','01') AND b.Fecha<=FechaFila 
AND b.CABINA_Id = CABINAID;

RETURN SUBSTRING(AcumuladoSuma,1,LOCATE('.',AcumuladoSuma)+2);

END */;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
