/*!50003 CREATE*/ /*!50020 DEFINER=`pablo`@`192.168.1.%`*/ /*!50003 FUNCTION `sumatoriaDifCapturaNew`(FechaFila VARCHAR(10), CABINAID INT, TraficoCapturaActu DECIMAL) RETURNS varchar(30) CHARSET utf8
BEGIN

DECLARE AcumuladoSuma 	VARCHAR(30);

IF TraficoCapturaActu IS NOT NULL THEN

	SELECT  (
			SUM( IFNULL(b.FijoLocal,0) )
			+ SUM( IFNULL(b.FijoProvincia,0) )
			+ SUM( IFNULL(b.FijoLima,0) )
			+ SUM( IFNULL(b.Rural,0) )
			+ SUM( IFNULL(b.Celular,0) )
			+ SUM( IFNULL(b.LDI,0) )
			- (
				SUM( IFNULL(b.TraficoCapturaDollar,0) 	        *  IFNULL(TRUNCATE(p.Valor,2),0) )
				+  ( IFNULL(TRUNCATE(TraficoCapturaActu,2),0)   *  IFNULL(TRUNCATE(p.Valor,2),0) )
			)
			) / IFNULL(TRUNCATE(p.Valor,2),0)
			INTO
					AcumuladoSuma
			FROM
					balance b,
					Paridad p
			WHERE
					b.PARIDAD_Id 	=  p.Id
					AND b.Fecha 	>= CONCAT(YEAR(FechaFila),'-0',MONTH(FechaFila),'-','01')
					AND b.Fecha		<= FechaFila
					AND b.CABINA_Id =  CABINAID;

	RETURN TRUNCATE(AcumuladoSuma,2);

END IF;

IF TraficoCapturaActu IS NULL THEN

	RETURN NULL;

END IF;

END */;;
