/*!50003 CREATE*/ /*!50020 DEFINER=`pablo`@`192.168.1.%`*/ /*!50003 FUNCTION `sumatoriaSobranteAcum`(IDBalanceActual VARCHAR(15)) RETURNS varchar(30) CHARSET utf8
BEGIN

	DECLARE SobranteAcum 	VARCHAR(30);
	DECLARE Paridad 		VARCHAR(30);
	DECLARE DifBanco 		VARCHAR(30);
	DECLARE DifClaro 		VARCHAR(30);
	DECLARE DifMovistar 	VARCHAR(30);
	DECLARE DifCaptura 		VARCHAR(30);
	DECLARE DifBrightstar 	VARCHAR(30);
	DECLARE Diferenciales 	VARCHAR(30);


	SELECT 	
			IFNULL(p.Valor,0)
			INTO
					Paridad
			FROM 	
					balance b,
					paridad p 
			WHERE
				b.PARIDAD_Id  = p.Id
				AND b.Id	  = IDBalanceActual;

	SELECT
		 (
			IFNULL(MontoBanco,0) -
			(
				IFNULL(FijoLocal,0)
				+ IFNULL(FijoProvincia,0)
				+ IFNULL(FijoLima,0)
				+ IFNULL(Rural,0)
				+ IFNULL(Celular,0)
				+ IFNULL(LDI,0)
				+ IFNULL(RecargaCelularMov,0)
				+ IFNULL(RecargaFonoYaMov,0)
				+ IFNULL(RecargaCelularClaro,0)
				+ IFNULL(RecargaFonoClaro,0)
				+ IFNULL(OtrosServicios,0)
		    )
		 )	AS 'Diferencial Banco'

		 INTO
				DifBanco 
		 FROM
				balance
		 WHERE
				Id = IDBalanceActual;

	SELECT
		 (
			(
				IFNULL(FijoLocal,0)
				+ IFNULL(FijoProvincia,0)
				+ IFNULL(FijoLima,0)
				+ IFNULL(Rural,0)
				+ IFNULL(Celular,0)
				+ IFNULL(LDI,0)
			)
				- ( IFNULL(TraficoCapturaDollar,0) * IFNULL(Paridad,0) )
		 )	AS 'Diferencial Captura'

		 INTO
				DifCaptura 
		 FROM
				balance
		 WHERE
				Id = IDBalanceActual;

	SELECT
		 (
				IFNULL(RecargaVentasClaro,0)  -
			  ( IFNULL(RecargaCelularClaro,0) + IFNULL(RecargaFonoClaro,0) )
		 )	AS 'Diferencial Claro'

		 INTO
				DifClaro 
		 FROM
				balance
		 WHERE
				Id = IDBalanceActual;

	SELECT
		 (
				IFNULL(RecargaVentasMov,0)  -
			  ( IFNULL(RecargaCelularMov,0) + IFNULL(RecargaFonoYaMov,0) )
		 )	AS 'Diferencial Movistar'

		 INTO
				DifMovistar 
		 FROM
				balance
		 WHERE
		   Id = IDBalanceActual;


	SET DifBrightstar = (DifClaro + DifMovistar);

	SET Diferenciales = (DifBanco + DifCaptura + DifBrightstar);

	SET SobranteAcum  = (Diferenciales/IFNULL(Paridad,0));

	RETURN TRUNCATE(SobranteAcum,2);


END */;;
DELIMITER ;
