/*!50003 CREATE*/ /*!50020 DEFINER=`manuelz`@`192.168.1.%`*/ /*!50003 PROCEDURE `corrige`()
BEGIN
DECLARE cierre FLOAT;
DECLARE com, reg INT;
DECLARE done INT Default 0;
DECLARE cur CURSOR FOR SELECT Id FROM pabrightstar WHERE Fecha='2013-05-17';
DECLARE CONTINUE HANDLER FOR SQLSTATE '02000' SET done = 1;
OPEN cur;
REPEAT
	FETCH cur INTO reg;
		IF NOT done THEN
			START TRANSACTION;
				SELECT Compania INTO com FROM pabrightstar WHERE Id=reg;
				SELECT SaldoAperturaPA+(SELECT IFNULL(TransferenciaPA+ComisionPA,0) FROM pabrightstar WHERE Id=reg)-(SELECT IFNULL(SUM(MontoRecarga),0) FROM recargas WHERE PABRIGHTSTAR_Id=reg AND FechaHora LIKE '2013-05-17') INTO cierre FROM pabrightstar WHERE Id=reg;
				UPDATE pabrightstar SET SaldoCierrePA=cierre WHERE Id=reg;
				INSERT INTO pabrightstar(Compania, SaldoAperturaPA, Fecha) VALUES(com, cierre, '2013-05-17' + INTERVAL 1 DAY);
		END IF;
UNTIL done END REPEAT;
CLOSE cur;
END */;;
