/*!50003 CREATE*/ /*!50020 DEFINER=`pablo`@`192.168.1.%`*/ /*!50003 PROCEDURE `sumatoriaDifCaptura`(IN FechaFila VARCHAR(10),IN ParidadID INT)
BEGIN

DECLARE Paridad VARCHAR(20);
DECLARE AcumuladoSuma VARCHAR(30);

SELECT TRUNCATE(Valor,2) INTO Paridad FROM paridad WHERE Id=ParidadID;

SELECT (
  SUM(FijoLocal) 
+ SUM(FijoProvincia) 
+ SUM(FijoLima) 
+ SUM(Rural) 
+ SUM(Celular) 
+ SUM(LDI) 
- SUM(TraficoCapturaDollar * Paridad) 
) / Paridad
INTO AcumuladoSuma FROM balance 

WHERE Fecha>=CONCAT(YEAR(curdate()),'-',MONTH(curdate()),'-','01') AND Fecha<=FechaFila;

UPDATE balance SET Acumulado=SUBSTRING(AcumuladoSuma,1,LOCATE('.',AcumuladoSuma)+2) WHERE Fecha=FechaFila;

END */;;
