/*!50003 CREATE*/ /*!50020 DEFINER=`manuelz`@`192.168.1.%`*/ /*!50003 PROCEDURE `temp`()
BEGIN
DECLARE cierre FLOAT;
DECLARE num, com, reg INT;
DECLARE cam INT Default 0;
DECLARE cur CURSOR FOR SELECT Id FROM pabrightstar WHERE Fecha='2013-05-09';
SELECT COUNT(Id) INTO num FROM pabrightstar WHERE Fecha='2013-05-09';
OPEN cur;
WHILE cam < num DO
	SET cam = cam + 1;
	FETCH cur INTO reg;
	START TRANSACTION;
		SELECT Compania INTO com FROM pabrightstar WHERE Id=reg;
		SELECT SaldoAperturaPA+(SELECT IFNULL(TransferenciaPA+ComisionPA,0) FROM pabrightstar WHERE Id=reg)-(SELECT IFNULL(SUM(MontoRecarga),0) FROM recargas WHERE PABRIGHTSTAR_Id=reg AND FechaHora LIKE CURDATE()) INTO cierre FROM pabrightstar WHERE Id=reg;
		UPDATE pabrightstar SET SaldoCierrePA=cierre WHERE Id=reg;
		INSERT INTO pabrightstar(Compania, SaldoAperturaPA, Fecha) VALUES(com, cierre, '2013-05-09' + INTERVAL 1 DAY);
END WHILE;
CLOSE cur;
END */;;
